import React from 'react';
import Card from './card'

function ExerciseList(props){
    return(
        <div>
            {props.exercises.map((el)=>{
      return(
        <Card title={el.title} description={el.description} img={el.img} leftColor={el.leftColor} rightColor={el.rightColor} />
      )
  })}
        </div>
    )
}
export default ExerciseList
